	'_sys_tour_homepage_account_menu_txt' => 'Add and manage profiles, check notifications, access account settings. Admins and Moderators can use it to access Dash with links to site content and profiles management.',
	'_sys_tour_homepage_welcome_title' => 'This is the Homepage',
	'_sys_tour_homepage_welcome_txt' => 'At first there isn\'t much here. Install more Apps via Studio, add more blocks via Studio > Pages > Homepage, create profiles, appoint admins, post some content and your site will come alive!',
	'_sys_tour_launcher_accounts_title' => 'You are more than Admin',
	'_sys_tour_launcher_accounts_txt' => 'UNA content and profiles are controlled by Admins and Moderators right on the site front-end, so you don’t have to worry about that in Studio. You do need to appoint your Admins and Moderators, though. And this is where you do it. If you also want to be the site Admin, just create your profile use “Set Membership” to upgrade it.',
	'_sys_tour_launcher_add_apps_title' => 'Now DO add new Apps!',
	'_sys_tour_launcher_add_apps_txt' => 'UNA comes with only a handful of core Apps. Choose, download and install Apps to add profiles types, modules, system tools, plugins, languages and design templates. You can activate and deactivate installed Apps. UNA is super-modular and incredibly flexible, letting you choose your own combination of functionality, settings and database structure to make the social site of your dreams real. Even without changing anything you will have the perfectly functioning social site!',
	'_sys_tour_launcher_apps_title' => 'Add and manage Apps',
	'_sys_tour_launcher_apps_txt' => 'Apps are modules, languages, tools, templates - all the bits and pieces that make your site unique. You can download and install Apps and they will appear in Studio Launcher. Apps add and change functionality of your site.',
	'_sys_tour_launcher_builder_forms_title' => 'Form and re-form your forms',
	'_sys_tour_launcher_builder_forms_txt' => 'Forms builder is a powerful tool that allows deep customisation of site database and forms. You can create and manage data lists, form fields and even display types (like Add/Edit/Delete). Your Forms will define the structure and theme of the site.',
	'_sys_tour_launcher_builder_menus_title' => 'Show them around',
	'_sys_tour_launcher_builder_menus_txt' => 'Add and manage site navigation menus. You can edit links, re-order them, add new ones, change icons and control visibility according to membership permissions.',
	'_sys_tour_launcher_builder_page_title' => 'Build your site the way you want it',
	'_sys_tour_launcher_builder_page_txt' => 'Pages allow you to edit the site by rearranging, adding and removing blocks on site pages. You can even create new custom pages of different types. You can also control visibility settings, SEO data, cacheing and page layouts.',
