	'_sys_tour_launcher_designer_title' => 'Start making your site special',
	'_sys_tour_launcher_designer_txt' => 'Designer is the best place to start customisation. Change the site logo, choose design template and manage the “Cover Page”. Your site now shows Cover Page to all guest visitors. You can either customise it to turn it off to display a full homepage with content of your choice.',
	'_sys_tour_launcher_favourites_title' => 'Choose wisely',
	'_sys_tour_launcher_favourites_txt' => 'Your Studio may have hundreds of installed Apps. Choose the ones you access most often and use the Star to bring them up.',
